import React from "react";
import {Linking, View} from "react-native";
import { MainStackParamList } from "../types/navigation";
import { NativeStackScreenProps } from "@react-navigation/native-stack";
import {Button, Layout, Text} from "react-native-rapi-ui";
import WerewolfLogo from "../components/utils/WerewolfLogo";
import {getPlayers} from "../provider/PlayersProvider";

export default function ({
     navigation,
 }: NativeStackScreenProps<MainStackParamList, "MainTabs">) {

    let players: object = {};
    getPlayers().then(res => {
        console.log(res);
    })

    const generateGame = () => {
        console.log('Player chose to generate automatically the game');
    }
    return (
        <Layout>
            <View
                style={{
                    flex: 1,
                    alignItems: "center",
                    justifyContent: "center",
                }}
            >
                <WerewolfLogo />
                <Text>Choix des cartes : </Text>
                <Button
                    style={{ marginTop: 10 }}
                    text="Sélection manuelle"
                    status="success"
                />
                <Button
                    style={{ marginTop: 10 }}
                    text="Génération automatique"
                    status="success"
                    onPress={generateGame}
                />

                {}

            </View>
        </Layout>
    );
}
